import React from 'react';
import s from "./Post.module.css";

const Post = (props) => {
    return (
        <div className={s.item}>
            <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSAtUWTJzEffdOWDHzAh_O-gGUe33pWc1f5inWM01qE-_GstFS7" />
            <h3>{props.message}</h3>
            <span><img src="https://cdn.freebiesupply.com/logos/large/2x/like-2-logo-svg-vector.svg" alt=""/>{props.likequantity}</span>
        </div>
    );
}

export default Post;
